const Greet = (props) => {
console.log(props)
return(
    <div>
        <h1>COME ON {props.name}. Do you know that this guy has scored {props.Goals} Goals !!!!</h1> <p>LETS BE HAVING YOU</p>
        {props.children}
    </div>    
    
    ) 
}
// export const Greet = () => <div><h1>COME ON!!!!</h1> <p>LETS BE HAVING YOU</p></div>

export default Greet
